import java.util.Arrays;
import java.util.Collection;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;

import static org.junit.Assert.*;

@RunWith(Parameterized.class)
public class ReconstructOriginalDigitsFromEnglishTest {
  @Parameterized.Parameter
  public String input;

  @Parameterized.Parameter(1)
  public String expectedResult;

  @Test
  public void test() {
    ReconstructOriginalDigitsFromEnglish testTarget = new ReconstructOriginalDigitsFromEnglish();
    String actual = testTarget.originalDigits(input);
    assertEquals(expectedResult, actual);
  }

  @Parameterized.Parameters
  public static Collection<Object[]> data() {
    return Arrays.asList(new Object[][]{
        {
          "estowteonfvvoweiefnuro",
          "122457"
        },
        {
            "",
            ""
        }
    });
  }
}
